pragma solidity ^0.4.0;

import "./EverDragonsExport.sol";

contract EverDragons is EverDragonsExport {

    event StateChanged(uint256 tokenId, uint32 newState);

    constructor() public {
        Dragon memory _dragon = Dragon({
            dna : 0,
            experience : 0,
            prestige : 0,
            fullness : 0,
            maxFullness : 0,
            name : ""
            });
        dragons.push(_dragon);
    }

    function getDragon(uint _tokenId) public view returns
    (uint256 dna, uint32 prestige, uint32 experience, uint16 fullness, uint16 maxFullness, string name) {
        Dragon storage dragon = dragons[_tokenId];
        return (dragon.dna, dragon.prestige, dragon.experience, dragon.fullness, dragon.maxFullness, dragon.name);
    }

    function getTokenIdForUser(address _owner, uint256 _index) external view returns (uint256 tokenId) {
        return tokenOfOwnerByIndex(_owner, _index);
    }

    // ===================================================================
    function setDragonState(uint256 tokenId, uint32 state) external modifierEnabled {
        dragonState[tokenId] = state;
        emit StateChanged(tokenId, state);
    }

    function getDragonState(uint256 tokenId) external view returns(uint32)   {
        return dragonState[tokenId];
    }
}
